options.rowCallback:
function(row, data, displayNum, displayIndex, dataIndex) {
var value=data[0]; $(this.api().cell(row, 0).node()).css({'font-weight':'bold','color':'#161616','background-color':value == "No Written Statement of Action" ? "#73a773" : value == "Written Statement of Action" ? "red" : value == "Previous Written Statement of Action Removed (after reinspection)" ? "#73a773" : value == "DfE and NHS England to determine if WSoA required" ? "orange" : value == "Written Statement of Action (after reinspection)" ? "red" : null});
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}
